import './App.css';
import {scroll, banner1, banner2, banner3} from './assets/export'

function App() {
  return (
    <>
      <div>
        <div><img src={banner1} alt="banner" /></div>
        <div><img src={banner2} alt="banner" /></div>
        <div><img src={banner3} alt="banner" /></div>
      </div>

    </>
  );
}

export default App;
